#include<bits/stdc++.h>
using namespace std;



class Solution {
public:
    string frequencySort(string s) {
        map<char,int> freq;
        for(char &c:s) freq[c]++;
        priority_queue<pair<int, char> > pq;
        for(auto &it: freq) {
            pair<int, char> pii = make_pair(it.second, it.first);
            pq.push(pii);
        }
        string ret = "";
        while(pq.size()) {
            pair<int,char> pci = pq.top();
            pq.pop();
            while(pci.first-- > 0 ) {
                ret.push_back(pci.second);
            }
        }
        return ret;
    }
};



int main() {
    string str ="";
    Solution sol;
    printf("%s\n",sol.frequencySort(str).c_str());
}